import image from '../image.png';


function escolherTarifa() {

    return(
        <div>
            <div style={{ background: "#2B2B31", height: 66, width: "100%", boxShadow: "0px 4px 4px 0px black" }}></div>

            <center>
                <img src={image} style={{
                    width: 100,
                    height: 100,
                    marginTop: "5%",
                }}></img>
            
            <form style={{
                    width: 315,
                    height:345,   
                    padding:10,
                    marginTop: "2%",
                    borderRadius: 27,
                    background: "#2B2B31",
                    boxShadow: "0px 4px 4px 0px rgba(0, 0, 0, 0.25)",
                    marginLeft: "2%",
                    marginBottom: "5%"
                }}></form>

            </center>
        </div>
    )

}

export default escolherTarifa;
